import React from "react";
import { FaTrashAlt } from 'react-icons/fa';
import {FaRegEdit} from 'react-icons/fa';

export class UsersComponent extends React.PureComponent{

    buttonClicked  = (event) => {
        event.preventDefault();
        console.log(event.target.value);
        console.log(event.target.id);

    }

    someFunction = (e) => {
        e.preventDefault();
        this.setState({
            field: e.target.value
        });
    }


    render(){
        return(
            <>
                <tr>
                    <td><input type="text" value={this.props.users.userID} /> </td>
                    <td>{this.props.users.firstName} {this.props.users.lastName}</td>
                    <td>{this.props.users.username}</td>
                    <td>{this.props.users.email}</td>
                    <td>{this.props.users.userRole}</td>
                    <td><button className="delete_user_button" ><FaTrashAlt/></button></td>
                    <td><button className="edit_user_button"><FaRegEdit/></button></td>
                    <td><button value="choicolate" id={this.props.users.userID} onClick={this.buttonClicked} className="btn btn-player">Delete</button></td>
                </tr>
            </>
        )
    }
}
